description:
Game Description:
******************
Save the day as the leader of the Rescue Team, a group of life-saving pros trained to swoop in and sweep up in the wake of a natural disaster! Race against the clock to collect gems, put out fires, and save stranded swimmers! Use strategy to figure out the quickest way to complete your goals! Rescue Team 4 is fun, gripping, and unlike any other game you've played!

